import React from 'react';
import { useSelector } from 'react-redux';

import video0 from '../assets/Fireworks Display.mp4';
import video1 from '../assets/Pexels Videos 4513.mp4';
import video2 from '../assets/Time Lapse Video Of Aurora Borealis.mp4';
import { sliderTransition } from '../store/actions/heroActions';

export const Landing = () => {
    const video = useSelector(state => state.heroReducer.video);
    const dispatch = useDispatch();

    const heroSlider = () => {
        dispatch(sliderTransition())
    }

    setTimeout(heroSlider, milliseconds)

    return (
        <div>
            <header>
                {video % 3 === 0 ? <video src={video0} autoPlay muted /> : null}
                {video % 3 === 1 ? <video src={video1} autoPlay muted /> : null}
                {video % 3 === 2 ? <video src={video2} autoPlay muted /> : null}
            </header>
        </div>
    )
}
